import React, { Component } from 'react'

export default class Category extends Component {
  render() {
    return (
      <div className="row">
        <div className="category col text-center btn-type">
          <a href="#" class="btn normal disabled">Normal</a>
          <a href="#" class="btn fighting disabled">Fighting</a>
          <a href="#" class="btn flying disabled">Flying</a>
          <a href="#" class="btn  disabled"></a>
        </div>
      </div>
    )
  }
}
